import { Component } from '@angular/core';

@Component({
  selector: 'app-myheader',
  standalone: true,
  imports: [],
  templateUrl: './myheader.component.html',
  styleUrl: './myheader.component.scss'
})
export class MyheaderComponent {
  isSidebarOpen = true;

  toggleSidebar() {
    this.isSidebarOpen = !this.isSidebarOpen;
  }

}
